import React, {useState} from 'react';
import data from "../restaurant-menu.json";

function Appetizer() {
    const [menu]= useState(data.array.categorys[0]["menu-items"]);

    return (
        <div className="Card">

                {menu.map((item)=>{
                    return(

                        <div className="Picture">
                            <img src ={item.images} alt="" />
                            <h4>{item.name}</h4>
                        </div>

                    );
                })}

        </div>
    )
}

export default Appetizer
